import images from "../public/images/dog-1.jpeg";
function App() {
  return (
    <div>
      <div className="box-1">
        <img src={require("../public/images/dog-1.jpeg")} />
      </div>
      <div className="box-2"></div>
      <div className="box-3"></div>
    </div>
  );
}

export default App;
